//! This module tests the library's analysis capabilities on the `Seaport`
//! contract.
#![cfg(test)]

use storage_layout_analyzer::watchdog::LazyWatchdog;

mod common;

/// Tests the analyser on the bytecode of the Seaport contract deployed
/// [here](https://etherscan.io/address/0x00000000000000adc04c56bf30ac9d3c0aaf14dc).
#[test]
fn correctly_generates_a_layout() -> anyhow::Result<()> {
    // Create the analyzer
    let bytecode = "";
    let analyzer = common::new_analyzer_from_bytecode(bytecode, LazyWatchdog.in_rc())?;

    // Get the final storage layout for the input contract
    let layout = analyzer.analyze()?;

    // We should see ...
    assert_eq!(layout.slot_count(), 1);

    Ok(())
}
